import React, { Fragment } from "react";
import GET from "./GET";
import POST from "./POST";
import Postchoices from "./postchoices";
export default function Dashboard() {
  return (
    <div>
      <Fragment>
        <Postchoices />
        <POST />
        <GET />
      </Fragment>
    </div>
  );
}
